            <div className="opencase">
                <h1>Freecase1</h1>
                <img src={'./'} alt="" />
                <button>Open $0.00</button>
            </div>

            <div className="case_item">
                <div className="image-container">
                <SkinTier tier={1} images={['../img/skin/Freecase1/tier1/DE_BluePly.png', '../img/skin/Freecase1/tier1/glock_oxide.png']} />
                <SkinTier tier={2} images={['../img/skin/Freecase1/tier2/p2000_aced.png', '../img/skin/Freecase1/tier2/mac7_monster.png', '../img/skin/Freecase1/tier2/tec9_avalanche.png']} />
                <SkinTier tier={3} images={['../img/skin/Freecase1/tier3/glock_neonoir.png', '../img/skin/Freecase1/tier3/m4_rain.png', '../img/skin/Freecase1/tier3/mac10_fade.png']} />
                <SkinTier tier={4} images={['../img/skin/Freecase1/tier4/awp_asiimov.png', '../img/skin/Freecase1/tier4/m4s4_rain.png']} />
                <SkinTier tier={5} images={['../img/skin/Freecase1/tier5/karam_saber.png', '../img/skin/Freecase1/tier5/navaja_fade.png']} />
                </div>
            </div>
        </>
    );
}

export default CaseOpened;
